import './App.css';
import Home from './screens/home.js'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <Home />
      </div>
    </Router>
  );
}

export default App;
